import React, { Component } from 'react';
import ReactDOM from 'react-dom';

export default class Form extends React.Component {
    constructor (props) {
        super(props);
    }

    render() {
        <div>
            <label> Email
                <input type="text"></input>
            </label>
            <label> Password
                <input type="text"></input>
            </label>
            <button type="submit">Login</button>
        </div>
    }
}

